Street Blowjobs - Ivy - So poison

April 24, 2011

Ivy was headed home from an afternoon of shopping when I pulled up in my truck and struck up a conversation. She told me how much money she spent and how she regretted it now because she could really use that money towards something more important than just clothes and knickknacks. I told her I could offer her a way to get some money back if she was adventurous enough. She knew exactly what I meant, and I offered her 500 dollars. She took the money and did not look back, that is, of course, until I splattered my goo all over her sweet ass.
